import styled from "styled-components";
import MainSecIconsService from "./MainSecIconsService"


const SectionCTA = styled.section`
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
`;

const Div = styled.div`
    width: 500px;
    flex-basis: 50%;
    height: 100px;
`

function Section06() {
    return (
        <SectionCTA>
            <Div></Div>
            <MainSecIconsService />
        </SectionCTA>
    )
};

export default Section06;
